import Link from 'next/link';
import React, { Component } from 'react';
import styled from 'styled-components';
import { Navbar, Nav } from 'react-bootstrap';

const Button = styled.button`
  color: palevioletred;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`;

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioletred;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

const linkStyle = {
  marginRight: 15
};

export const Header = () => {
    return(
        <div>
           <Wrapper>
    <Title>
      Hello World!
    </Title>
              <Link href="/">
                <Button>Home</Button>
              </Link>
              <Link href="/about">
                <Button>About</Button>
              </Link>
              </Wrapper>
        </div>
    );
  }

export default Header;

